import React from "react";

class Footer extends React.Component{
    render(){
        return (
          <p>
            Copyright &copy; <span>2020 </span>
            <a href="https://github.com/steve-ryan">Steve Ryan</a>
          </p>
        );
    }
}
export default Footer;
